        {
            id : 3,
            title : 'Google Data Analytics Professional Certificate',
            details : 'Learned to conduct full lifecycle analysis to produce insights and learned to communicate data to stakeholders.',
            date : 'Dec 21, 2021',
            field : 'Data Analytics',
            image : 'https://i.ibb.co/wCtRG8r/data-analytics.png'
        },
        {
            id : 4,
            title : 'Python 3 programming Specialization',
            details : 'learned python 3 programming from basics to advance',
            date : 'Dec 21, 2021',
            field : 'Python',
            image : 'https://i.ibb.co/rmdHyhR/python-3.png'
        },
        {
            id : 5,
            title : `University's "HALL OF FAME"`,
            details : `As the student with the greatest CGPA, I was inducted into the university's hall of fame`,
            date : '',
            field : 'HALL OF FAME',
            image : 'https://i.ibb.co/jvMG3sR/1684351758082.jpg'
        }

    ]
}


